Rails + MongoDB not returning all documents in collection<p>I need all the documents in one of my collections to create association in between my parent model to child. The problem is I only have the string of my ObjectId. So I am finding the object by string and then set via <code>parent.child = foundObject</code>. So, to achieve this I created a private method as below, to not to create DB request each time I need that child object.</p>
<pre><code>def childs
   @childs ||= Child.all
end
</code></pre>
<p>But this is not working as expected. When I run <code>ModelName.all</code> it returns below result; not all the docs in collection.</p>
<pre><code>=&gt; 
#&lt;Mongoid::Criteria
  selector: {}
  options:  {}
  class:    ModelName
  embedded: false&gt;
</code></pre>
<p>And this causes my loop to create another DB request each time I try to associate child to parent. I prevent this by using below method.</p>
<pre><code>def childs
   @childs ||= Child.all.select { |v| v.id.present? }
end
</code></pre>
<p>I believe there should be a way of collecting all documents in MongoDB, I know the idea of <strong>Mongoid::Criteria</strong> and what it actually does. But in some case, I need all the objects to be stored in one variable. Do not want to create unwanted DB queries each time I need one specific document in a model.</p>

