Trying to write a recursive asynchronous search in JavaScript<p>I am trying to write some code that searches through a bunch of objects in a MongoDB database. I want to pull the objects from the database by ID, then those objects have ID references. The program should be searching for a specific ID through this process, first getting object from id, then ids from the object.</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-html lang-html prettyprint-override"><code>async function objectFinder(ID1, ID2, depth, previousList = []) {
    let route = []
    if (ID1 == ID2) {
        return [ID2]
    } else {
        previousList.push(ID1)
        let obj1 = await findObjectByID(ID1)
        let connectedID = obj1.connections.concat(obj1.inclusions) //creates array of both references to object and references from object
        let mapPromises = connectedID.map(async (id) =&gt; {
            return findID(id) //async function
        })
        let fulfilled = await Promise.allSettled(mapPromises)
        let list = fulfilled.map((object) =&gt; {
            return object.value.main, object.value.included
        })
        list = list.filter(id =&gt; !previousList.includes(id))
        for (id of list) {
            await objectFinder(id, ID2, depth - 1, previousList).then(result =&gt; {
                route = [ID1].concat(result)
                if (route[route.length - 1] == ID2) {
                    return route
                }})
        }
    }
    if (route[route.length - 1] == ID2) {
        return route
    }
}</code></pre>
</div>
</div>
</p>
<p>I am not sure how to make it so that my code works like a tree search, with each object and ID being a node.</p>

