<p>I created my own Dockerfiles for mongodb and node and also a docker-compose file. Mongoose is able to connect with my MongoDB container.</p>
<p>When I try to create a document, I am unable to find it via mongoose or via mongo shell. I also created a document in the same db via mongo shell and I am still not able to find it.</p>
<h3>MongoDB dockerfile</h3>
<pre><code>FROM ubuntu:20.04

RUN apt update
RUN apt install -y wget gnupg
RUN wget -qO - https://www.mongodb.org/static/pgp/server-5.0.asc | apt-key add -

RUN echo &quot;deb [ arch=amd64,arm64 ] https://repo.mongodb.org/apt/ubuntu focal/mongodb-org/5.0 multiverse&quot; | \
        tee /etc/apt/sources.list.d/mongodb-org-5.0.list

RUN apt update
RUN apt install -y mongodb-org=5.0.2 mongodb-org-database=5.0.2 mongodb-org-server=5.0.2  \
        mongodb-org-shell=5.0.2 mongodb-org-mongos=5.0.2 mongodb-org-tools=5.0.2
EXPOSE 27017
CMD [&quot;/usr/bin/mongod&quot;, &quot;-f&quot;, &quot;/etc/mongod.conf&quot;]
</code></pre>
<h3>Node Dockerfile</h3>
<pre><code>FROM ubuntu:20.04

SHELL [&quot;/bin/bash&quot;, &quot;-c&quot;]

RUN apt update
RUN apt install -y curl

RUN mkdir /usr/local/nvm
ENV NVM_DIR /usr/local/nvm
ENV NODE_VERSION 14.18.1

RUN curl -o- https://raw.githubusercontent.com/nvm-sh/nvm/v0.39.0/install.sh | bash \
        &amp;&amp; source $NVM_DIR/nvm.sh \
        &amp;&amp; nvm install v$NODE_VERSION

ENV NODE_PATH $NVM_DIR/v$NODE_VERSION/lib/node_modules
ENV PATH $NVM_DIR/versions/node/v$NODE_VERSION/bin:$PATH

RUN mkdir /usr/app

WORKDIR /usr/app

COPY . /usr/app
RUN npm install

RUN npm install -g nodemon

EXPOSE 3000

CMD [&quot;nodemon&quot;, &quot;index.js&quot;]
</code></pre>
<h3>Docker Compose File</h3>
<pre><code>version: &quot;3.9&quot;

services: 
  db:
    image: db
    build: 
      context: ./
      dockerfile: Dockerfile.mongodb
    ports:
      - &quot;27017:27017&quot;
    volumes:
      - /home/rohit/Downloads/mongodb_data:/var/lib/mongodb

  app:
    image: app
    build: 
      context: ./
      dockerfile: Dockerfile.node
    ports:
      - &quot;3000:3000&quot;
    volumes: 
      - /home/rohit/github_repos/node-react-jenkins-docker/:/usr/app
    depends_on:
      - db
</code></pre>
