d2a4a2ca229a   db        &quot;/usr/bin/mongod -f …&quot;   About an hour ago   Up About an hour   0.0.0.0:27017-&gt;27017/tcp, :::27017-&gt;27017/tcp   node-react-jenkins-docker_db_1
